import React from 'react'

class SearchResults extends React.Component{
    render(){
        return(
            <div className='SearchResults'>
                {this.props.results.map(item=>{
                    <>
                    <li>{item.title}</li>
                    <li>{item.link}</li>
                    <li>{item.htmlSnippet}</li>
                    </>
                })}
            </div>
        )
    }
}

export default SearchResults
